import React from "react";
import { BoxBufferGeometry, Mesh } from "three";

export default function Building(){
    return (
        <mesh>
            <BoxBufferGeometry attach='geometry'/>
            <meshLambertMaterial attach='material' color='blue'/>
        </mesh>
    );
}
